import '../Assets/styles/Footer.css'

export default function Footer() {
    return (
        <div className="Footer">
            <div>
                <p className="completedCount">0 /</p>
                <p className="todosCount">3</p>
            </div>
            <button className="deleteCompleted">Delete Completed</button>
        </div>
    );
}
